INSERT INTO `manga` (`id`, `name`, `release`, `genre`, `status`, `numberofchapter`, `summary`, `author`, `coverimage`, `mangareaderinfolink`) VALUES
(1, 'SWORD ART ONLINE - PROGRESSIVE', 2013, 'Action, Fantasy, Shounen', 0, 36, '<p>T<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">his series is a reboot of the SAO Aincrad Arc starting from a day or two before the clearing of the First Floor Boss, and continuing onwards. The first chapter was included in the Anime despite not being part of the main Light Novel series.</span></p>', 'Kawahara Reki', 'https://vignette.wikia.nocookie.net/swordartonline/images/b/bc/Progressive_Manga_Vol_1_Cover.png/revision/latest?cb=20140704065814', 'http://mangareader.info/mangafox/sword-art-online-progressive'),
(2, 'SHOKUGEKI NO SOMA - ETOILE', 2015, 'Comedy, Drama, Shounen', 0, 7, '<p>T<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">his spin-off follows Kojir? Shinomiya after his return to France following his defeat at the hands of Megumi and Souma.</span></p>', 'Itou Michiko', 'https://vignette.wikia.nocookie.net/shokugekinosoma/images/8/8f/L%27%C3%A9toile_Chapter_1.jpg/revision/latest?cb=20150307115535', 'http://mangareader.info/mangafox/shokugeki-no-soma-etoile'),
(3, 'KATTOBI ITTO', 1986, 'Shounen ; Comedy ; Sports', 1, 17, '<p>K<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">atori Itto and Yura Kazuma are childhood rivals. Itto is small and quarrelsome while Kazuma is big and vindictive. Itto has been holding a grudge against Kazuma for a long time from the scar Kazuma made him five years ago during a fight&hellip; After years of travelling with his father, Itto finally returns to Japan only to reunite with a childhood rival, Kazuma. A very hilarious combination of circumstances will bring the unpredictable Itto to join Kazuma\'s soccer team at Seiga Middle School&hellip; The manga follows this wacky duo as they, alongside the rest of the team, \'battle\' other middle school teams on the road to becoming Japan \'s best.</span></p>', 'Kadoma motoki', 'https://vignette.wikia.nocookie.net/itto/images/1/1c/Kattobi_Itto_Vol_1_Cover.png/revision/latest?cb=20160724140642', 'http://mangareader.info/mangafox/kattobi-itto'),
(4, 'MASAMUNE-KUN NO REVENGE', 2012, 'Harem ; Romance ; School life', 0, 46, '<p>M<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">akabe Masamune has changed himself greatly for a single reason: he wants revenge. Contrary to his past, he has worked hard to become good-looking in order to carry out this goal. Faster than anticipated, he even meets the target of his revenge the first day after transferring in.. Adagaki Aki! He wastes no time beginning his plan, but revenge doesn\'t come easily.</span></p>', 'Takeoka Hazuki', 'https://vignette.wikia.nocookie.net/masamunekuns-revenge/images/3/34/Image.png/revision/latest?cb=20160216171028', 'http://mangareader.info/mangafox/masamune-kun-no-revenge'),
(5, 'ROKU DE NASHI MAJUTSU KOUSHI TO KINKI KYOUTEN', 2015, 'Comedy ; Ecchi ; Fantasy', 0, 24, '<p>T<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">he manga of the popular Light Novel series of the same name: Sisti attends a magical academy to hone her skills in the magical arts, and hopes to solve the mystery of the enigmatic Sky Castle. After the retirement of her favorite teacher, the replacement, Glen, turns out to be a tardy, lazy, seemingly incompetent bastard of an instructor. How was it that Glen was hand-picked by the best magician in the academy!?</span></p>', 'Hitsuji Tarou', 'https://static.comicvine.com/uploads/scale_large/6/67663/5719894-01.jpg', 'http://mangareader.info/mangafox/roku-de-nashi-majutsu-koushi-to-kinki-kyouten'),
(6, 'KIMI NO NA WA', 2016, 'School life ; Sci fi ; Supernatural', 1, 5, '<p>A girl stranded in a small lakeside village deep within the mountains, Mitsuha, and a boy caught up in the oddly orderly chaos of bustling Tokyo, Taki, begin to dream of another, unfamiliar life. Before long, they realize that they aren&rsquo;t dreaming at all, but actually switching bodies. Separated even further apart than they ever would have imagined, yet still somehow inexplicably connected, they search for the truth behind their strange phenomenon and discover what really happened on that fateful night when the stars rained from the sky.</p>', 'Shinkai Makoto', 'https://i.pinimg.com/736x/bf/f4/4b/bff44b786d593a55c4033afe4eef7f84--box-office-film.jpg', 'http://mangareader.info/mangafox/kimi-no-na-wa'),
(7, 'ACCEL WORLD', 2010, 'Romance ; School life ; Sci fi', 0, 42, '<p>F<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">rom Yen Press: No matter how much the times change, bullied kids aren&rsquo;t going anywhere. And fat junior high school student Haruyuki is one of them. But one day, Haruyuki encounters Kuroyukihime, the most beautiful and elegant girl at school, who gives him a mysterious program: &ldquo;Brain Burst&rdquo;&hellip;and the secret of the &ldquo;Accelerated World.&rdquo; He may be at the bottom of the food chain at school, but Haruyuki and his destiny begin to &ldquo;accelerate&rdquo; with incredible speed in the virtual realm as he aims for the top.</span></p>', 'Kawahara Reki', 'https://images.gr-assets.com/books/1437271139l/15736419.jpg', 'http://mangareader.info/mangafox/accel-world'),
(8, 'YAHARI ORE NO SEISHUN RABUKOME WA MACHIGATTE IRU', 2012, 'Comedy ; Romance ; School life', 0, 27, '<p>F<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">rom AnimeNewsNetwork: Watari\'s (author) romantic comedy revolves around an antisocial high school student named Hachiman Hikigaya with a distorted view on life and no friends or girlfriend. When he see his classmates talking excitedly about living their adolescent lives, he mutters, "They\'re a bunch of liars." When he is asked about his future dreams, he responds, "Not working." A teacher gets Hachiman to join the volunteer "service club," which happens to have the school\'s prettiest girl, Yukino Yukinoshita.</span></p>', 'Watari Wataru', 'https://ia.media-imdb.com/images/M/MV5BYThiYTM3YTEtODI3OS00Mjc4LTlmOWItZjk4NGI5ZDFiMDgwL2ltYWdlL2ltYWdlXkEyXkFqcGdeQXVyNjc2NjA5MTU@._V1_SY1000_CR0,0,697,1000_AL_.jpg', 'http://mangareader.info/mangafox/yahari-ore-no-seishun-rabukome-wa-machigatte-iru-mougenroku'),
(9, 'MAYO CHIKI!', 2010, 'Seinen ; Comedy ; Ecchi', 0, 38, '<p>K<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">onoe Subaru, a classmate of Sakamachi Kinjirou, has been serving as the butler of Suzutsuki Kanade in school. Due to an accident, Sakamachi discovers Konoe\'s secret...that he is actually a she!? Apparently she will be removed from her position if anyone at school finds out. What will unfold from this chain of events?</span></p>', 'Asano Hajime', 'https://upload.wikimedia.org/wikipedia/vi/1/13/Mayo_Chiki%21_DVD_boxset_cover.jpg', 'http://mangareader.info/mangafox/mayo-chiki'),
(10, 'KOKORO CONNECT', 2010, 'Slice of life ; Supernatural', 0, 8, '<p>T<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">he story involves five high school students, Taichi, Iori, Himeko, Yoshifumi and Yui, who are all members of the Cultural Research Club. One day, they begin experiencing a phenomenon in which they randomly swap bodies amongst themselves. As these five friends face many different phenomena at the whims of a mysterious being known as Heartseed, their friendship is put to the ultimate test.</span></p>', 'Anda Sadanatsu', 'https://i.pinimg.com/originals/ee/ef/26/eeef26bc4e002f23eacd3a0e7684f0be.jpg', 'http://mangareader.info/mangafox/kokoro-connect'),
(11, 'SWORD ART ONLINE', 2010, 'Fantasy ; Romance ; Sci fi', 1, 11, '<p>F<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">rom Yen Press: In the year 2022, gamers rejoice as Sword Art Online - a VRMMORPG (Virtual Reality Massively Multiplayer Online Role Playing Game) like no other - opens its virtual doors, allowing players to take full advantage of the ultimate in gaming technology: NerveGear, a system that allows users to completely immerse themselves in the game world by manipulating their brain waves to create a wholly realistic gaming experience.</span></p>', 'Kawahara Reki', 'https://ae01.alicdn.com/kf/HTB1T._UNVXXXXXLaXXXq6xXFXXXx/Sword-Art-Online-Anime-Characters-210-150CM-Single-side-Quilt-Cover-38780.jpg_640x640.jpg', 'http://mangareader.info/mangafox/sword-art-online'),
(12, 'SWORD ART ONLINE ALTERNATIVE - GUN GALE ONLINE', 2015, 'Action ; Fantasy ; Sci fi', 0, 3, '<p>T<span style="color: #4b5362; font-family: \'open sans\', Arial, Helvetica, sans-serif; font-size: 13px;">he story follows Karen Kohiruimaki, a 183-centimeter-tall (6-foot-tall) college student who\'s insecure about her height, and is bad at dealing with people in the real world. She enters the world of Gun Gale Online with her avatar, Ren, who is less than 150 centimeters (5 feet) tall and wears all pink. She meets a beautiful, brown-skinned female player who goes by Pitohui. They hit it off, but one day Pitohui pressures her to participate in "Squad Jam," a team battle royale variation of the Bullet of Bullets tournament.</span></p>', 'Kawahara Reki', 'http://img1.ak.crunchyroll.com/i/spire2/bf43e93ccea2ef51e45a85da7f26d0241520664704_full.jpg', 'http://mangareader.info/mangafox/sword-art-online-alternative-gun-gale-online');
